export default function Contact(){
    return(
        <div>
            <p>Phone: 444 444 444</p>
            <p>Email: Someimportant@gmail.com</p>
            <a href="https://www.instagram.com/MercedesBenzUSA/"><img src="./img/instagram.png" alt=""/></a>
            <a href="/https://www.instagram.com/MercedesBenzUSA"><img src="./img/facebook.png" alt=""/></a>
            <a href="https://www.instagram.com/MercedesBenzUSA/"><img src="./img/instagram.png" alt=""/></a>
        </div>
    )
}
